css:
atom-text-editor::shadow .find-result .region {
  background-color: transparent;
  border-radius: 2px;
  box-sizing: border-box;
  border: 2px solid #ffff00;
}
atom-text-editor::shadow .highlights .highlight-selected .region {
  background-color: transparent;
  border-radius: 2px;
  box-sizing: border-box;
  border: 2px solid #ffff00;
}
atom-text-editor,
:host {
  background-color: #1b1d1e;
  color: #f8f8f2;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .indent-guide:first-child,
:host .indent-guide:first-child {
  color: transparent;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .invisible,
:host .invisible {
  color: #f8f8f2;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #f8f8f0;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 3px solid #0066ff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #403d3d;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #232526;
  color: #465457;
  border-right: 1px solid #181818;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  background: #232526;
  color: #465457;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #999999;
  font-weight: 100;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #fd971f;
}
atom-text-editor .gutter .line-number:hover,
:host .gutter .line-number:hover {
  color: #999999;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #999999;
  background: #465457;
}
atom-text-editor .gfm .markup.heading,
:host .gfm .markup.heading {
  color: #A6E22E;
  font-weight: bold;
}
atom-text-editor .gfm .markup.underline,
:host .gfm .markup.underline {
  color: #E6DB74;
  text-decoration: underline;
}
atom-text-editor .gfm .bold,
:host .gfm .bold {
  font-weight: bold;
}
atom-text-editor .gfm .italic,
:host .gfm .italic {
  font-style: italic;
}
atom-text-editor .gfm .raw,
:host .gfm .raw {
  color: #66D9EF;
}
atom-text-editor .gfm .variable.list,
:host .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
atom-text-editor .gfm .link.underline,
:host .gfm .link.underline,
atom-text-editor .gfm .link,
:host .gfm .link {
  color: #666;
}
atom-text-editor .gfm .link.underline .entity,
:host .gfm .link.underline .entity,
atom-text-editor .gfm .link .entity,
:host .gfm .link .entity {
  color: #AE81FF;
}
.comment {
  color: #7E8E91;
}
.string {
  color: #A6E22E;
}
.constant.character.escape {
  color: #99ff99;
}
.regexp {
  color: #99ff99;
}
.regexp .string {
  color: #99ff99;
}
.support.function.decl {
  color: #E6DB74;
}
.entity.other.attribute-name.id {
  color: #E6DB74;
}
.variable.less,
.variable.scss {
  color: #ffcc00;
}
.meta.function .entity.name.method,
.meta.method .entity.name.method,
.meta.function .entity.name.function,
.meta.method .entity.name.function {
  color: #ffcc00;
}
.entity.name.class,
.entity.other.inherited-class,
.entity.name.accessor {
  color: #ffcc00;
  text-decoration: none;
}
.entity.other.inherited-class {
  font-style: italic;
}
.storage.type {
  font-style: italic;
  color: #66D9EF;
}
.keyword.control.js {
  color: #66D9EF;
}
.entity.name.instance {
  color: #66D9EF;
}
.support.constant {
  color: #66D9EF;
}
.support.type.property-name {
  color: #66D9EF;
  text-decoration: underline;
  font-style: normal;
}
.meta.function.arrow.js {
  color: #66D9EF;
}
.meta.function.arrow.js .storage.type {
  font-style: normal;
}
.meta.function.arrow.js .separator {
  color: #fff;
}
.variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.meta.function .punctuation.definition.parameters {
  color: #FD971F;
}
.keyword.control.flow {
  color: #FD971F;
}
.entity.other.attribute-name {
  color: #FD971F;
}
.string.unquoted.label.js {
  color: #ff6600;
}
.object.key.js .string {
  color: #ff6600;
}
.meta.structure.dictionary.json:not(.value) > .string.quoted.double.json,
.meta.structure.dictionary.json:not(.value) > .string.quoted.double.json > .punctuation.definition.string.json {
  color: #FD971F;
}
.entity.other.pseudo-class {
  color: #ff6600;
}
.constant.numeric {
  color: #AE81FF;
}
.constant.language {
  color: #AE81FF;
}
.constant.character,
.constant.escape,
.constant.other {
  color: #AE81FF;
}
.class.jade {
  color: #AE81FF;
}
.support.constant.property-value {
  color: #AE81FF;
}
.keyword {
  color: #F92672;
}
.storage {
  color: #F92672;
}
.entity.name.tag,
.keyword.control.elements {
  color: #F92672;
  text-decoration: underline;
}
.entity.name.tag.custom,
.keyword.control.elements.custom {
  text-decoration: none;
}
.keyword.control.at-rule {
  color: #F92672;
}
.variable.language.js {
  color: #F92672;
}
.punctuation.terminator.statement.js {
  color: #F92672;
}
.meta.delimiter.comma.js {
  color: #F92672;
}
.punctuation.separator.key-value.js {
  color: #F92672;
}
.meta .braces,
.meta .brace {
  color: #ccc;
}
.entity.name.function,
.meta.function-call .entity.name.function {
  color: #ffffff;
  font-style: normal;
}
.support.function {
  color: #ffffff;
  text-decoration: underline;
}
.support.class,
.support.type {
  font-style: normal;
  color: #ffffff;
  text-decoration: underline;
}
.support.class .keyword,
.support.type .keyword {
  color: #ffffff;
}
.keyword.operator.bracket,
.keyword.operator.punctuation {
  color: #FFFFFF;
}
.invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
autocomplete-suggestion-list .word {
  color: #999;
}
